      {"5865ff59-2fec-44c4-b334-0aec7f145cd5":{"version":"3.4.1","title":"Bokeh Application","roots":[{"type":"object","name":"Tabs","id":"p164164","attributes":{"sizing_mode":"stretch_both","tabs":[{"type":"object","name":"TabPanel","id":"p164155","attributes":{"title":"Summary","child":{"type":"object","name":"Div","id":"p164154","attributes":{"styles":{"type":"map","entries":[["width","100%"],["height","100%"],["max-width","1920px"],["max-height","1080px"],["padding","12px"],["border","1px solid lightgray"],["box-shadow","inset 1px 0 8px 0 lightgray"],["overflow","auto"]]},"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n\n        &lt;h2&gt; Duration: 14m 58s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 42 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 13m 5s &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://127.0.0.1:46697 &lt;/li&gt;\n          &lt;li&gt; Workers: 48 &lt;/li&gt;\n          &lt;li&gt; Threads: 48 &lt;/li&gt;\n          &lt;li&gt; Memory: 187.47 GiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2024.6.0 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2024.6.0 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\n#!/usr/bin/env python\nfrom __future__ import print_function, division\nimport numpy as np\nimport MDAnalysis as mda\nfrom MDAnalysis import Universe, Writer\nimport dask\nfrom dask.distributed import Client, performance_report\nfrom dask.delayed import delayed\nfrom dask import multiprocessing\nfrom dask.multiprocessing import get\nfrom MDAnalysis.analysis.align import rotation_matrix\nfrom MDAnalysis.lib.qcprot import CalcRMSDRotationalMatrix\nimport time\nimport multiprocessing\nfrom shutil import copyfile\nimport glob, os\nimport warnings\nfrom Bio import BiopythonDeprecationWarning\nwarnings.simplefilter('ignore', BiopythonDeprecationWarning)\nwarnings.filterwarnings('ignore', category=DeprecationWarning, module='MDAnalysis.coordinates.DCD')\n\ndef rmsd(mobile, xref0):\n    xmobile0 = mobile.positions - mobile.center_of_mass()\n    return CalcRMSDRotationalMatrix(xref0.T.astype(np.float64), xmobile0.T.astype(np.float64), mobile.n_atoms, None, None)\n\ndef block_rmsd(ag, ref0, start=None, stop=None, step=None):\n    u = ag.universe\n    xref0 = ref0.positions - ref0.center_of_mass()\n\n    clone = mda.Universe(u._topology, u.trajectory.filename, **u.kwargs)\n    g = clone.atoms[ag.indices]\n    assert u != clone\n\n    bsize = stop - start\n    print(\"block_rmsd\", start, stop, step)\n    print(len(clone.trajectory))\n    bsize = stop - start\n    results = np.zeros([bsize, 2])\n    t_comp = np.zeros(bsize)\n\n    start1 = time.time()\n    for iframe, ts in enumerate(clone.trajectory[start:stop:step]):\n        start2 = time.time()\n        results[iframe, :] = ts.time, rmsd(g, xref0)\n        t_comp[iframe] = time.time() - start2\n\n    t_all_frame = time.time() - start1\n    t_comp_final = np.mean(t_comp)\n\n    return results, t_comp_final, t_all_frame, bsize\n\ndef com_parallel_dask(ag, n_blocks, client):\n    ref0 = ag.universe.select_atoms(\"protein\")\n\n    bsize = int(np.ceil(ag.universe.trajectory.n_frames / float(n_blocks)))\n    print(\"setting up {} blocks with {} frames each\".format(n_blocks, bsize))\n\n    blocks = []\n    for iblock in range(n_blocks):\n        start, stop, step = iblock * bsize, (iblock + 1) * bsize, 1\n        print(\"dask setting up block trajectory[{}:{}]\".format(start, stop))\n\n        out = delayed(block_rmsd)(ag, ref0, start=start, stop=stop, step=step)\n        blocks.append(out)\n\n    output = client.compute(blocks, sync=True)\n    results = np.vstack([out[0] for out in output])\n    t_comp_avg = np.mean([out[1] for out in output])\n    t_comp_max = np.max([out[1] for out in output])\n    t_all_frame_avg = np.mean([out[2] for out in output])\n    t_all_frame_max = np.max([out[2] for out in output])\n    bsize_total = np.sum([out[3] for out in output])\n\n    return results, t_comp_avg, t_comp_max, t_all_frame_avg, t_all_frame_max, bsize_total\n\nif __name__ == \"__main__\":\n    print(mda.__version__)\n    PSF, DCD1 = [\"adk4AKE.psf\", \"1ake_007-nowater-core-dt240ps.dcd\"]\n    num_cores = multiprocessing.cpu_count()\n    client = Client(n_workers=num_cores)\n    dask.config.set(scheduler='distributed')\n\n    with performance_report(filename=\"performance_report.html\"):\n        with open('data.txt', mode='w') as file:\n            traj_size = [25, 50, 100]  # Smaller trajectory sizes for testing\n            for k in traj_size:  # Iterate over trajectory sizes\n                u1 = mda.Universe(PSF, DCD1)\n                longDCD = 'newtraj.dcd'\n                with mda.Writer(longDCD, u1.atoms.n_atoms) as W:\n                    for i in range(k):\n                        for ts in u1.trajectory:\n                            W.write(u1)\n                u = mda.Universe(PSF, longDCD)\n\n                ii = 2\n                block_size = [1, 2, 4]  # Smaller block sizes for testing\n                for i in block_size:  # Iterate over block sizes\n                    for j in range(1, 3):  # Fewer iterations per block size for testing\n                        longDCD1 = f'newtraj{ii}.dcd'\n                        copyfile(longDCD, longDCD1)\n                        u = mda.Universe(PSF, longDCD1)\n                        mobile = u.select_atoms(\"(resid 1:29 or resid 60:121 or resid 160:214) and name CA\")\n\n                        start = time.time()\n                        results, t_comp_avg, t_comp_max, t_all_frame_avg, t_all_frame_max, bsize_total = com_parallel_dask(mobile, i, client)\n                        tot_time = time.time() - start\n\n                        file.write(f\"XTC{k} {i} {j} {t_comp_avg} {t_comp_max} {t_all_frame_avg} {t_all_frame_max} {tot_time} {bsize_total}\\n\")\n                        file.flush()\n\n                        os.remove(f'newtraj{ii}.dcd')\n                        ii += 1\n\n    client.close()\n\n        &lt;/pre&gt;\n        "}}}},{"type":"object","name":"TabPanel","id":"p164159","attributes":{"title":"Task Stream","child":{"type":"object","name":"Figure","id":"p163803","attributes":{"name":"task_stream","sizing_mode":"stretch_both","x_range":{"type":"object","name":"DataRange1d","id":"p163801","attributes":{"range_padding":0}},"y_range":{"type":"object","name":"DataRange1d","id":"p163802","attributes":{"range_padding":0}},"x_scale":{"type":"object","name":"LinearScale","id":"p163813"},"y_scale":{"type":"object","name":"LinearScale","id":"p163814"},"title":{"type":"object","name":"Title","id":"p163806","attributes":{"text":"Task Stream"}},"renderers":[{"type":"object","name":"GlyphRenderer","id":"p163843","attributes":{"data_source":{"type":"object","name":"ColumnDataSource","id":"p163798","attributes":{"selected":{"type":"object","name":"Selection","id":"p163799","attributes":{"indices":[],"line_indices":[]}},"selection_policy":{"type":"object","name":"UnionRenderers","id":"p163800"},"data":{"type":"map","entries":[["start",[1718743240573.535,1718743262653.1562,1718743280141.9834,1718743280885.5762,1718743294541.9675,1718743294923.9587,1718743306152.2852,1718743306457.495,1718743306581.6313,1718743306797.161,1718743315696.3513,1718743315990.7346,1718743316222.1687,1718743316385.6394,1718743428222.9475,1718743471582.6768,1718743507214.5405,1718743507162.8022,1718743533202.5063,1718743534016.5852,1718743555686.3938,1718743556049.0823,1718743556259.1785,1718743556428.925,1718743573390.2942,1718743573569.4724,1718743573914.4722,1718743573958.369,1718743780992.8396,1718743871194.2551,1718743940118.38,1718743941063.24,1718743992903.007,1718743993899.2625,1718744038959.7073,1718744038
